import React, { useState, useEffect } from "react";
import axios from "axios";
import youtube from "./api/youtube";

// console.log(process.env.REACT_APP_YOUTUBE_API_KEY)
// https://youtube.googleapis.com/youtube/v3/channels?part=snippet%2CcontentDetails%2Cstatistics&id=UCu2YhywZvs7pXUEL3RCUEaA&key=AIzaSyAbnlDjtTzRH0MXRtdWapejsD5V0yzKLS0
// Channel ID = UCu2YhywZvs7pXUEL3RCUEaA
// API key = AIzaSyAbnlDjtTzRH0MXRtdWapejsD5V0yzKLS0

const Filter = (props) => {

  return (
      <div>
          Search for videos: <input value={props.value} onChange={props.onChange} />
      </div>
  )
}

const App = () => {
  const [videos, setVideos] = useState([]);
  const [videoFilter, setVideoFilter] = useState("");

  const handleChange = (event) => {
    console.log(event.target.value);
    setVideoFilter(event.target.value);
  };

  useEffect(() => {
    axios
      .get(
        `https://www.googleapis.com/youtube/v3/search?key=${process.env.REACT_APP_YOUTUBE_API_KEY}&channelId=UCu2YhywZvs7pXUEL3RCUEaA&part=snippet,id&order=date&maxResults=20`
      )
      .then((response) => {
        console.log(response.data.items);
        setVideos(response.data.items);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);
  console.log("render", videos.length, "videos");
  console.log(videos);

  return (
    <div>
      <input value={videoFilter} onChange={handleChange} />

      <ul>
        {videos.map((video) => (
          <li key={video.id.videoId}>{video.snippet.title}</li>
        ))}
      </ul>
    </div>
  );
};

export default App;
